const App3 = () => {
    const dog = e => {
    e.target.setAttribute('src', './Media/dog.jpeg');
}

const cat = e => {
    e.target.setAttribute('src', './Media/cat.jpeg');
}

const fox = e => {
    e.target.setAttribute('src', './Media/fox.jpeg');
}


return (
    <div>
        <button id='dog' onClick={dog}>Dog</button>
        <button id='cat' onClick={cat}>Cat</button>
        <button id='fox' onClick={fox}>Fox</button>
    </div>
);
}
export default App3;
